import React from 'react';

const PropertyItem = ({ id, location, title, price, rating }) => {
	return (
		<div>
			<img
				alt='robots'
				src={`https://robohash.org/${id}?200x200`}
			/>
			<div>
				<h2> {location} </h2>
				<h2> {title} </h2>
				<h3> {`$ ${price} CAD/night`}</h3>
				<h3> {rating} </h3>
			</div>
		</div>
	);
};

export default PropertyItem;
